Now we can make the dog speak by adding a public member method to the Dog's impl block. struct Dog { age: u8,
} impl Dog { pub fn new(age: u8) -> Self { Self { age } } pub fn celebrate_birthday(&mut self) { self.age = self.age + 1; println!("Wiggly butt is {} wags old!", self.age); } pub fn speak(&self) { println!("Woof!"); }
} fn main() { let mut dog = Dog::new(8); dog.celebrate_birthday(); dog.speak();
