8.body:
Let's give our dog an age and allow them to celebrate their birthday. struct Dog { age: u8,
} impl Dog { pub fn celebrate_birthday(&mut self) { self.age = self.age + 1; println!("Wiggly butt is {} wags old!", self.age); }
} fn main() { let mut dog = Dog { age: 8 }; dog.celebrate_birthday();
} Note that we have to add the mut keyword to the dog to be able to mutate it. In this case, the mutation is incrementing its age when celebrating its birthday. In Rust, objects are immutable by default.

