Constructors in Rust are just functions that return an instance of an object. They are not treated specially by the language itself like they are in C++. struct Dog { age: u8,
} impl Dog { pub fn new(age: u8) -> Self { Self { age } } pub fn celebrate_birthday(&mut self) { self.age = self.age + 1; println!("Wiggly butt is {} wags old!", self.age); }
} fn main() { let mut dog = Dog::new(8); dog.celebrate_birthday();
}
